objetoCompra:
A contratação do serviço justifica-se pelas seguintes razões:
A realização do Seminário de Extensão, Ensino, Pesquisa e Inovação (SE²P²IN), é um evento essencial no calendário institucional, organizado pela Pró-Reitoria de Extensão, Pesquisa, Pós-Graduação e Inovação (PROEPPI);
Fortalecimento da imagem instituciona e aprimoramento da qualidade do ensino, pesquisa, extensão e inovação tecnológica;

