A necessidade de atendimento dos demandantes (Documento de Formalização da Demanda CA/CAPANEMA 3142886), especialmente quanto à continuidade do uso do veículo institucional nas necessidades diárias do campi.

Que a aquisição pela dispensa eletrônica com disputa tornaria o processo mais demorado, considerando prazo de publicação, recebimento e avaliação de novas propostas;

Que a referida contratação é considerada de pequeno valor e que a utilização de fornecedores locais garante a agilidade no fornecimento e também promove o desenvolvimento econômico e social no âmbito local;



Por todo o exposto, a Direção de Planejamento e Administração do Campus Capanema decide pela contratação direta, através da escolha de melhor proposta entre pesquisa com fornecedores, com a empresa Porto Seguro Cia de Seguros Gerais - CNPJ 61.198.164/0001-60, no valor de R$ 1.129,85 (um mil cento e vinte e nove reais e oitenta e cinco centavos), com base no disposto no art. 75, inciso I, da Lei nº. 14.133/2021.

O curso Técnico em Cooperativismo iniciou suas atividades a par da implantação do Campus do IFPR na cidade de Capanema, de forma que figura na instituição e na sociedade como um curso prestigiado e reconhecidamente formador de bons profissionais. Nesse contexto, busca-se através da presente aquisição, a incorporação de novas tecnologias às práticas pedagógicas, auxiliando no processo ensino-aprendizagem. Portanto, a aquisição do software educacional de simulação gerencial visa garantir aos discentes uma visão prática para integração das disciplinas específicas do curso Técnico em Cooperativismo, culminado com a melhoria da qualidade do ensino em geral.

Assim, faz-se necessária a aquisição de um programa computacional que possa contemplar as necessidades pontuadas. Neste sentido, destacamos mais alguns pontos a serem considerados quando da análise do item a ser adquirido:

O referido software deve permitir acesso, de forma simultânea, de no mínimo 35 discentes por módulo;

A licença deverá permanecer ativa pelo período de 12 meses;

Ser 100% online, e preferencialmente, permitir acesso via tablets e smartphones;

Deve possuir capacitação básica para docentes;

Suporte gratuito para docentes habilitados e material de apoio;

Módulo de apoio nas tomadas de decisões incluso;

Por fim, ante as motivações apresentadas, considerando a necessidade pela aquisição do objeto para assegurar o devido desenvolvimento das atividades fins e dos objetivos do Instituto Federal do Paraná e a intenção de realizar uma contratação eficaz, com vistas a suprir as demandas do corpo discente e docente desta instituição naquilo que se equipara à efetiva produção do conhecimento e prover as equipes administrativas de suporte à educação, na medida do que for conscientemente necessário ao exercício de suas funções, esta Administração informa, portanto, que realizará a aquisição através de Dispensa de Licitação, sendo que o procedimento em epígrafe está subsidiariamente embasado nos termos do Art. 75, inciso II, da Lei nº 14.133/2021.
